import React from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";

const Profile = () => {
  const followerList = [
    { nickname: "제로초" },
    { nickname: "제로초" },
    { nickname: "제로초" },
  ];

  const followingList = [
    { nickname: "제로초" },
    { nickname: "제로초" },
    { nickname: "제로초" },
  ];

  return (
    <>
      <Head>
        <title>내 프로필 | NodeBird</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowingList header="팔로잉 목록" data={followingList}/>
        <FollowerList header="팔로워 목록" />
      </AppLayout>
    </>
  );
};

export default Profile;
